  let [alphabet, setAlphabet] = useState({
    letters: [
      {name: 'A', checked: false},
      {name: 'B', checked: false},
      {name: 'C', checked: false}
    ] 
  })
  return (
    <div className="App">
      <Letters rowNum="5" alphabet={alphabet.letters}/>
    </div>
  );
}

export default App;
